import React, { Component } from "react";

class SecretCode extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <input
        className="form-control col-md-4 m-auto"
        style={{ position: "absolute", top: "65vh" }}
      />
    );
  }
}
export default SecretCode;
